import React from "react";
import "./collection.styles.scss"
import CollectionItem from "../../components/collection-item/collection-item.component"
import {connect} from "react-redux";
import { selectShopItems } from '../../redux/shop/shop.selector';
import {createStructuredSelector} from 'reselect';
import { useParams } from "react-router-dom";

const Category = ({collections})=>{
    const name =useParams().category;
    const category = collections.filter(item=>item.routeName===name);
    const collection = category.items
    console.log(collection)

    return(  
    <div className="collection-page">
        <div className="title">{name}</div>
        <div>{collection.map(({id, ...info})=><CollectionItem key={id} item={info}/>)}</div>
    </div>)
}

const mapStatetoProps = createStructuredSelector(
    {collections : selectShopItems}
)

export default (connect)(mapStatetoProps)(Category);
